INSERT INTO `subjects` (`id`, `name`, `slug`, `description`, `image_source`, `prof`, `preview_image`, `duration`, `year_level`) VALUES
(1, 'Human Computer Interaction', 'human-computer-interaction', 'Human-computer interaction (HCI) is a research field that studies and designs the interaction between people and computers. It is a multidisciplinary field that involves computer science, behavioral sciences, design, and other fields of study. HCI aims to make computer technology more user-friendly and more usable by considering various factors, such as user capabilities, preferences, experience, personality, cognitive abilities, motivation, and emotion. HCI also includes the implementation and evaluation of user interfaces for computer systems.', 'data:image/jpeg;base64,', 'Prof.Micheal Noel Tolentino', 'data:image/webp;base64,', '05 hours 15 minutes', '2nd');
INSERT INTO `subjects` (`id`, `name`, `slug`, `description`, `image_source`, `prof`, `preview_image`, `duration`, `year_level`) VALUES
(2, 'Object Oriented Programming', 'object-oriented-programming', 'Object-oriented programming (OOP) is a programming paradigm that uses classes and objects to structure a software program. Classes are blueprints for creating objects, which are instances of classes. Objects have their own properties and behavior, which may contain data and code. OOP is used to implement real-world things in software development, such as inheritance, hiding, and polymorphism. OOP languages are usually class-based.', 'data:image/jpeg;base64,', 'Prof.Dianna P. Suk', 'data:image/png;base64,', '05 hours 15 minutes', '2nd');
INSERT INTO `subjects` (`id`, `name`, `slug`, `description`, `image_source`, `prof`, `preview_image`, `duration`, `year_level`) VALUES
(3, 'Physical Education 4 (Team Sports)', 'physical-education-4', 'Physical Education 4\'s goal is to inspire students to experiment with both indoor and outdoor physical activities. This course is crucial for students at all levels because it fosters social skills and serves as a reminder that learning can be more than just doing homework. Four sports\' histories will be covered in this course: basketball, volleyball, softball/baseball, and football. Learn the fundamental hand signals and movements for the four sports that are included: football, basketball, volleyball, and softball/baseball. You should also demonstrate how to play each sport.', 'data:image/png;base64,', 'Prof.John Paul Ludovice', 'data:image/jpeg;base64,', '05 hours 15 minutes', '2nd');
INSERT INTO `subjects` (`id`, `name`, `slug`, `description`, `image_source`, `prof`, `preview_image`, `duration`, `year_level`) VALUES
(4, 'Office Productivity 4 (AutoCad)', 'office-productivity-autocad', 'Office Productivity 3 Animation Course is a training program focused on enhancing animation skills within the context of office productivity tools. It is designed to teach individuals how to create dynamic and engaging presentations, documents, and spreadsheets using animation techniques. Participants can expect to gain practical skills in creating visually compelling animations to enhance their office productivity tasks, presentations, and documents.', 'data:image/jpeg;base64,', 'Prof.Edmar Tan', 'data:image/jpeg;base64,', '05 hours 15 minutes', '2nd');
INSERT INTO `subjects` (`id`, `name`, `slug`, `description`, `image_source`, `prof`, `preview_image`, `duration`, `year_level`) VALUES
(5, 'Rizal\'s Life, Works And Writting', 'rizal-works-and-writing', 'The course Rizal\'s Life, Works, And Writing aims to give students a better knowledge of Rizal\'s contributions to Philippine history, culture, and the war for independence. Students will analyze Rizal\'s role as a reformist and his impact on national consciousness through a combination of lectures, readings, conversations, and multimedia tools.', 'data:image/png;base64,', 'Prof.Ivan Jorelle Opena', 'data:image/jpeg;base64,', '05 hours 15 minutes', '2nd');
INSERT INTO `subjects` (`id`, `name`, `slug`, `description`, `image_source`, `prof`, `preview_image`, `duration`, `year_level`) VALUES
(6, 'Math In The Modern World', 'math-in-the-modern-world', 'Mathematics in the modern world is a subject or discipline that deals with the nature, appreciation, and application of mathematics in different branches and aspects of life. Mathematics is a universal language that helps us understand our surroundings and solve problems. Mathematics is based on patterns and numbers that can be found in nature and the world. Some of the famous mathematicians who contributed to the development of mathematics in the modern world are Euler, Sir Isaac Newton, Carl Gauss, and Benoit Mandelbrot. Mathematics in the modern world covers topics such as the Fibonacci sequence, variables, sets, relations, functions, reasoning, statistics, and linear regression.', 'data:image/png;base64,', 'Prof. Nica Lamar Tan', 'data:image/jpeg;base64,', '05 hours 15 minutes', '2nd');
INSERT INTO `subjects` (`id`, `name`, `slug`, `description`, `image_source`, `prof`, `preview_image`, `duration`, `year_level`) VALUES
(7, 'Advance Algebra', 'advance-algebra', 'Mathematics in the modern world is a subject or discipline that deals with the nature, appreciation, and application of mathematics in different branches and aspects of life. Mathematics is a universal language that helps us understand our surroundings and solve problems. Mathematics is based on patterns and numbers that can be found in nature and the world. Some of the famous mathematicians who contributed to the development of mathematics in the modern world are Euler, Sir Isaac Newton, Carl Gauss, and Benoit Mandelbrot. Mathematics in the modern world covers topics such as the Fibonacci sequence, variables, sets, relations, functions, reasoning, statistics, and linear regression.', 'data:image/webp;base64,', 'Lowell Ed', 'data:image/jpeg;base64,', '05 hours 15 minutes', '2nd');
